export default function About() {
  return (
    <div className="about">
      <img
        className="aboutImage"
        src="https://images.pexels.com/photos/4261783/pexels-photo-4261783.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260"
      />
    </div>
  );
}
